try
{
	var varietyContent = Get<string>("SrmVarietyContent");
	var artifactId = Get<Guid>("SrmArtifact");
	var approvalObjectId = Get<Guid>("SrmApprovalObject");
	var approvalObjectRecordId = Get<Guid>("SrmApprovaObjectRecordId");

	var helper = ClassFactory.Get<SrmApprovalServiceHelper>(new ConstructorArgument("userConnection", UserConnection));
	var content = helper.GenerateContent(approvalObjectId, approvalObjectRecordId, varietyContent);

	Set("SrmArtifactContent", content);

	var files = helper.GetApprovalObjectFiles(approvalObjectId, approvalObjectRecordId);

	foreach (var file in files)
	{
		var data = SrmFileDataHelper.GetFileDataFromDataBase(UserConnection, file.Schema.Name, file.PrimaryColumnValue);
		var name = file.GetTypedColumnValue<string>("Name");

		var schema = UserConnection.EntitySchemaManager.GetInstanceByName("SrmArtifactFile");
		var artifactFile = schema.CreateEntity(UserConnection);
		artifactFile.UseAdminRights = false;
		artifactFile.SetDefColumnValues();
		artifactFile.SetColumnValue("Name", name);
		artifactFile.SetColumnValue("TypeId", SrmCoreConstantsCS.FileType.File);
		artifactFile.SetColumnValue("SrmArtifactId", artifactId);
		artifactFile.Save(false);
		SrmFileDataHelper.UploadFileData(UserConnection, artifactFile, data, "SrmArtifact");
	}
}
catch (Exception ex)
{
	throw new Exception(ex.Message, ex);
}

return true;
